"use client";
import React, { useState } from "react";
import { ArrowLeft, ArrowRight } from "lucide-react";
const tabs = [
  {
    label: "Exterior",
    images: [
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSzqPMQG4PUoBQPe_0vpwSHZikjqCwS3oeEJg&s",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
    ],
  },
  {
    label: "Interior",
    images: ["/gallery-int1.jpg", "/gallery-int2.jpg", "/gallery-int3.jpg"],
  },
  {
    label: "Virtual tour",
    images: ["/gallery-virt1.jpg", "/gallery-virt2.jpg"],
  },
];

const GallerySection = () => {
  const [active, setActive] = useState(0);
  const handlePrev = () => {
    setActive((prev) => (prev === 0 ? tabs.length - 1 : prev - 1));
  };

  const handleNext = () => {
    setActive((prev) => (prev === tabs.length - 1 ? 0 : prev + 1));
  };

  return (
    <section className="bg-black text-white px-20 py-20">
      <div className="">
        <p className="uppercase text-center mb-5 opacity-60 tracking-tight text-[13px]">
          gallery
        </p>
        <h2 className="text-6xl gilda-display-regular text-center mb-10">
          Take a glance at our craft
        </h2>

        <div className="flex justify-center mt-20 gap-16 mb-8">
          {tabs.map((tab, idx) => (
            <button
              key={tab.label}
              className={`pb-1 border-b-2 w-28 transition text-xl gilda-display-regular ${
                active === idx
                  ? "border-white"
                  : "border-transparent text-gray-400"
              }`}
              onClick={() => setActive(idx)}
            >
              {tab.label}
            </button>
          ))}
        </div>

        {/* GALLERY GRID */}
        <div className="flex gap-4 mt-10">
          <div className="flex-1">
            <img
              src={tabs[active].images[0]}
              alt={tabs[active].label}
              className="w-full h-[496px] object-cover "
            />
          </div>

          <div className="flex flex-col gap-4 w-[30%]">
            {tabs[active].images.slice(1).map((img, i) => (
              <img
                key={i}
                src={img}
                alt={tabs[active].label}
                className="w-full h-[240px] object-cover "
              />
            ))}
          </div>
        </div>
      </div>

      <div className="flex items-center justify-center gap-2 mt-10 ">
        <button
          onClick={handlePrev}
          className="w-12 h-12 cursor-pointer flex items-center justify-center rounded-full hover:bg-zinc-700 shadow-md bg-zinc-800 transition"
        >
          <ArrowLeft color="white" size={24} />
        </button>
        <button
          onClick={handleNext}
          className="w-12 h-12 cursor-pointer flex items-center justify-center rounded-full hover:bg-zinc-700 shadow-md bg-zinc-800 transition"
        >
          <ArrowRight size={24} />
        </button>
      </div>
    </section>
  );
};

export default GallerySection;
